import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import Navbar from '../layout/Navbar';

const Dashboard = (props) => {
  return (
    <div>
      <Navbar />
      <Fragment>
        <h1>Dashboard</h1>
      </Fragment>
    </div>
  );
};

Dashboard.propTypes = {

};

export default Dashboard;
